Location.prototype.find	= function(id) {
	if(typeof(this.items[id]) == "undefined")
		return false;
	return this.items[id];
}

Location.prototype.fillOption	= function(el_id , loc_id , selected_id) {
	var el	= $('#'+el_id); 
	var loc_id =loc_id.split(",");
	var json = this.find(loc_id[0]); //获得所有数据 
	if (json) {
		
		if(loc_id.length == 1){
			for(var i=0;i<json.length;i++){
				var option	= '<option value="'+json[i].name+'">'+json[i].name+'</option>';
				el.append(option);
				if (json[i].name == selected_id) {
					selected_index	= i;
				}
			}
		}else if(loc_id.length == 2){
			for(var i=0;i<json.length;i++){
				if(json[i].name == loc_id[1]){
					var ctiys = json[i].city;
					for(var j=0;j<ctiys.length;j++){
						var option	= '<option value="'+ctiys[j].name+'">'+ctiys[j].name+'</option>';
						el.append(option);
						if (ctiys[j].name == selected_id) {
							selected_index	= j;
						}
					}
					break;
				}
				
			}	
		}else if(loc_id.length == 3){
			for(var i=0;i<json.length;i++){
				if(json[i].name == loc_id[1]){
					var ctiys = json[i].city;
					for(var j=0;j<ctiys.length;j++){
						if(ctiys[j].name == loc_id[2]){
							var countys = ctiys[j].county;
							for(var k=0;k<countys.length;k++){
								var option	= '<option value="'+countys[k].name+'">'+countys[k].name+'</option>';
								el.append(option);
								if (countys[k].name == selected_id) {
									selected_index	= k;
								}
							}
							break;
						}
					}
					break;
				}
			}	
		}
		
		/*var index	= 1;
		var selected_index	= 0;
		$.each(json , function(k , v) {
			var option	= '<option value="'+k+'">'+v+'</option>';
			el.append(option);
			
			if (k == selected_id) {
				selected_index	= index;
			}
			
			index++;
		})*/
		//el.attr('selectedIndex' , selected_index); 
	}
	el.select2("val", "");
}

